import { useState, useEffect } from "react";
import MessengerList from "./MessengerList";
import useFetch from "./useFetch";

const Home = () => {

    const {data: messengers, isPending, error} = useFetch("http://localhost:8000/blogs");

    return (
        <div className="home">
            { error && <div>{error}</div>}
            { isPending && <div>Loading...</div>}
            {messengers && <MessengerList messengers = {messengers} title = "Messengerss"/>}
        </div>
    );
}
 
export default Home;
